import {Routes, Switch, Route} from 'react-router-dom';


const App = () => {
  return (
    <Routes>
      <Switch>
        <Route path = '/quotes' element = {<Quote />} />
        <Route path = '/quotes/:quoteId' element = {<Quote />} />
        <Route path = '/new-quote' element = {<Quote />} />
      </Switch>
    </Routes>
  )
}
export default App;
